import { useState } from 'react';

const useIconsState = (cardNumber: string) => {
  const [iconsState, setIconsState] = useState({
    [cardNumber]: {
      watch: false,
      favorite: false,
    },
  });

  return { iconsState, setIconsState };
};

export default useIconsState;
